import React from "react";
import Parse from "parse";
import NavigationBar from "../../components/NavigationBar/NavigationBar";
import PageTitle from "../../components/PageTitle/PageTitle";
import Button from "../../components/Button/Button";
import "./../../App.css";
import "./Settings.css";

export default function Settings() {
  console.log("current user", Parse.User.current());

  return (
    <div>
      <header>
        <div>
          <div>
            <PageTitle title="Settings" />
          </div>
        </div>
        <div>
          <img
            className="logo-small"
            src={require("./../../graphics/app_logo_small.png")}
            alt="Tripster Logo"
            height="56"
            width="56"
          ></img>
        </div>
      </header>

      <body>
        <div className="buttons">
          <div className="settings-buttons">
            <Button text="Hide profile" type="login" />
          </div>
          <div className="settings-buttons">
            <Button text="Reset password" type="login" />
          </div>

          <div className="settings-buttons">
            <Button text="Log out" type="signup" click={handleLogOut} />
          </div>
        </div>

        <div className="centering">
          <NavigationBar
            discover={"idle"}
            chat={"idle"}
            settings={"active"}
            profile={"idle"}
          />
        </div>
      </body>
    </div>
  );
}
